column8:
●ポッキンプラグ付なので、2芯・3芯のどちらでもアダプターなしに差し込めます。<br><br>

●アース付なので万一漏電が起きても安心です。<br>
(工具が絶縁不良になった時、漏電電流を大地に逃がし感電しないようになります)<br><br>

●電線は、SVCT2.0mm2×3芯(ソフト電線)を採用しているので寒冷地でも固くなりません。<br><br>

【色】：  グリーン<br>
【コンセント個数】：  3<br>
【コンセント形状】：  三相<br>
【電線長さ(m)】：  0.5<br>
【電線太さ(mm2)：  2<br>
【電線仕様-種別：  SVCT<br>
【電線仕様-芯数：  3<br>
【コンセント仕様】：  接地2P・15A・125V<br>
【プラグ形状】：  Lヘナポッキンプラグ<br><br>

≪ トリプルポッキンタイプ ≫ <br><br>
屋内型 : ＜PPT-0.5E＞ <br><br>
屋内型/Lヘナポッキンプラグ : ＜PPTL-0.5E＞ <br><br>
屋外型/防雨キャップ付き : ＜PPTW-0.5E＞ <br><br>

<br /><br />

